import React from 'react';

const Range = (props) => (
  <div className="range">
    <span> {props.label}: {props.value}</span>
    <input
      type="range" min="1" value={props.imdb} step={props.step} max={props.max}
      onChange={props.handleChange}
      name={props.name}
    />


  </div>
);

export default Range;
